	('edit-profile', '2016-09-19 05:16:59.242754', '2023-01-18 10:26:26.766414', 'Administrator', 'Administrator', 0, 0, 'Update Profile', 'update-profile', 1, 'User', 'Core', 1, '', 1, 0, 1, 0, 0, 0, 0, NULL, 0, 0, 0, 0, NULL, 0, NULL, 0, NULL, NULL, NULL, '[{"title": _("My Account"), "route": "me"}]', NULL, '/me', 'Profile updated successfully.', NULL, NULL, NULL, 'frappe.web_form.after_load = () => {\n    if (window.location.pathname.endsWith("/new") && frappe.session.user) {\n        let current_path = window.location.href;\n        window.location.href = current_path.replace("/new", "/" + frappe.session.user);\n    }\n}', NULL, NULL, NULL, NULL, NULL),
	('request-data', '2019-01-24 16:19:26.886096', '2022-07-18 16:51:07.281527', 'Administrator', 'Administrator', 0, 0, 'Request Data', 'request-data', 1, 'Personal Data Download Request', 'Website', 1, '<div class="ql-editor read-mode"><p>Request a file containing your personally identifiable information (PII) that is saved on our system. The file will be in JSON format and is sent to you by email. If you would like to have your PII deleted from our system, please make a <a href="/request-to-delete-data" rel="noopener noreferrer">request to delete data</a>.</p></div>', 0, 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, 0, NULL, 0, NULL, 0, NULL, 'Request Data', NULL, '', NULL, '/desk', 'A download link with your data will be sent to the email address associated with your account.', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL),
	('request-to-delete-data', '2019-01-25 14:24:12.588810', '2022-07-18 16:51:30.949738', 'Administrator', 'Administrator', 0, 0, 'Request for Account Deletion', 'request-for-account-deletion', 1, 'Personal Data Deletion Request', 'Website', 1, '<div class="ql-editor read-mode"><p>Send a request to delete your account and personally identifiable information (PII) that is stored on our system. You will receive an email to verify your request. Once the request is verified we will take care of deleting your PII. If you just want to check what PII we have stored, you can <a href="/request-data" rel="noopener noreferrer">request your data</a>.</p></div>', 0, 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, 0, NULL, 0, NULL, 0, NULL, 'Submit', NULL, '', NULL, '/', 'An email to verify your request has been sent to your email address. Please verify your request to complete the process.', NULL, NULL, NULL, '', '[data-doctype="Web Form"] {\n    width: 50%;\n    margin: 6rem auto;\n}', NULL, NULL, NULL, NULL);

